import React from 'react'
import NavButton from './NavButton'
import FormatListBulletedIcon from '@mui/icons-material/FormatListBulleted';
import AnnouncementIcon from '@mui/icons-material/Announcement';
import ContactPageIcon from '@mui/icons-material/ContactPage';
import LinkIcon from '@mui/icons-material/Link';
import NavProfile from './NavProfile';

const Buttons = [
  {text: "Projects", url: "/projects", img: () => <FormatListBulletedIcon />},
  {text: "Announcements", url: "/announcements", img: () => <AnnouncementIcon />},
  {text: "Contacts", url: "/contacts", img: () => <ContactPageIcon />},
  {text: "Links", url: "/links", img: () => <LinkIcon />}
]

const Navbar = () => {

  return (
    <div className="flex flex-row">
      <div className="flex flex-column basis-1/4">
        <div className="navbar bg-mbaRed font-Nunito min-h-screen">
          <NavProfile className="navbar__profile" />
              {Buttons.map((button, i) => {
                return <NavButton 
                        img={button.img()} 
                        text={button.text}
                        url={button.url}
                        key={i} />
              })}
        </div>
      </div>
      <div className="flex flex-column basis-3/4 bg-mbaRed">
        <div className="bg-red">

        </div>
      </div>
    </div>
  )
}

export default Navbar
